import React from 'react'

export default function Todo() {
    const todos = [{ id: 't1', title: 'tweet milk' }, { id: 't2', title: 'try to clean needle work' }, { id: 't3', title: 'learn Node.js' }]

    return (
        <ul>
            {
                todos.map(todo => <li key={todo.id}>{todo.title}</li>)
            }
        </ul>
    )
}
